import React from 'react'
import { Component } from 'ag-grid-community';
class Login extends React.Component{
    constructor(props){
        super(props)
        this.state={
            name:''
        }
    }
    render(){
        return(
            <React.Fragment>
                <h1> login page</h1>
            </React.Fragment>
        );
    }
}
export default Login;
